            'element': deep_result.get('target_element'),
            'deep_elements_found': len(deep_result.get('deep_elements', [])),
            'click_context': deep_result.get('target_element', {}).get('context', 'unknown'),
            'error': deep_result.get('javascript_click', {}).get('error') if not deep_result['success'] else None
        }

        return result

    def disable_deep_click(self):
