                        success: true,
                        element: {{
                            tagName: element.tagName,
                            className: element.className,
                            id: element.id,
                            text: element.textContent?.substring(0, 50)
                        }}
                    }};
                }} catch (e) {{
                    return {{
                        success: false,
                        error: e.message
                    }};
                }}
            }})()
        """)

        # Remove crosshair
        if self.crosshair_screenshots:
