            page_id: The page ID
            command: The Playwright command to execute (e.g., "page.click({position: {x: 100, y: 200}})")

        Returns:
            Dict with command execution result
        """
        response = await self.post('/command', {
            'session_id': session_id,
            'page_id': page_id,
            'command': command
        })
        return response

